import React from "react";

export default function index() {
  return (
    <div className="container">
      <nav>
        <ul>
          <li>
            <a>Contact Me</a>
          </li>

          <li>
            <a>Projects</a>
          </li>

          <li>
            <a>Home</a>
          </li>
        </ul>
      </nav>
      <div>
        <h1>Hey I am Olalekan</h1>
        <p> Aspiring Full Stack Developer</p>
        <style jsx>{`
          p {
            color: blue;
          } 
          div {
            background: lightblue;
         }
         .container {
            background: lightblue;
         } 
         `} </style>

     </div>
    </div>
  );
}
